import { useState } from "react";
import Link from "next/link";



function Page(){

    const [adicionar, setAdicionar] = useState(0);

    function Adicionar() {
        setAdicionar(adicionar + 1);
        
    }
      

    return (
        <div>
            <div>Hejo</div>
            <br/>
            <div>{adicionar}</div>
            <button onClick={Adicionar}>Adicionar</button><br/><br/><br/>

            <form onSubmit=''>
                
                    <input 
                    name= 'username'
                    type='text'
                    placeholder='username   '
                    />
                
            </form>
            <Link href='/home'>
            <button >Home</button>
            </Link>
        </div>
    )}
export default Page;
